  null,
  null,
  null,
  null,
  null,
];

function App() {
  const [table, setTable] = useState([]);

  useEfect(() => {
    fetch();
  });

  return (
    <div className="App d-flex">
      <div className="grow3 d-flex flex-wrap">
        {table.map((x, i) => (
          <SingleCell key={i} item={x} />
        ))}
      </div>
      <div className="grow1">
        <CreateReservation />
        <CancelReservation />
      </div>
    </div>
  );
}

export default App;
